import GalleryData from './components/GalleryData';

function App() {
  const [GalleryData,setGallery]=useState(GalleryData);
  return (
    <div className="App">
       <main>
            <Switch>
            <Route path="/" component={updates} exact />
                <Route path="/Gallery" component={Gallery} />
                <Route path="/favorite" component={favorite} />
            </Switch>
        </main>
      {/* <SNavbar/>
      <FNavbar/> */}
     {/* <Updates/> */}
     <Gallery/>

    </div>
  );
}

export default App;
